import ham from "../img/ham.jpeg";
const Projects = () => {
  return (
    <div className="projects">
      <div className="container">
        <div className="project-flex">
          <div className="project-item">
            <figure>
              <img src={ham} alt="" />
              <figcaption>
                <h3>Ham's residence</h3>
              </figcaption>
            </figure>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Projects;
